import React, { Component } from 'react';
import Navigation from './components/navigation/Navigation';
import Logo from './components/logo/Logo';
import ImageLinkForm from './components/imageLinkForm/ImageLinkForm';
import Rank from './components/rank/Rank';
import Particles from "react-tsparticles"; 
import Clarifai from 'clarifai';
import './App.css';



// const app = new Clarifai.App({
//   apiKey: '2cf6d5922c874864959cf6f9b7e6973e'
// });

const particlesOptions = {
  fpsLimit: 120,
  interactivity: {
    events: {
      onClick: {
        enable: true,
        mode: "push",
      },
      resize: true,
    },
    modes: {
      bubble: {
        distance: 400,
        duration: 2,
        opacity: 0.8,
        size: 40,
      },
      push: {
        quantity: 4,
      },
      repulse: {
        distance: 200,
        duration: 0.4,
      },
    },
  },
  particles: {
    color: {
      value: "#ffffff",
    },
    links: {
      color: "#ffffff",
      distance: 150,
      enable: true,
      opacity: 0.5,
      width: 1,
    },
    collisions: {
      enable: true,
    },
    move: {
      direction: "none",
      enable: true,
      outMode: "bounce",
      random: false,
      speed: 1,
      straight: false,
    },
    number: {
      density: {
        enable: true,
        area: 800,
      },
      value: 100,
    },
    opacity: {
      value: 0.5,
    },
    shape: {
      type: "circle",
    },
    size: {
      random: true,
      value: 5,
    },
  },
  detectRetina: true,
}


class App extends Component{

  constructor(){
    super();
    this.state = {
      input:'',
    }
  }

  onInputChange = (event) =>{
    console.log(event.target.value);
  }

  onSummit = () =>{
    console.log('click');

    // app.model.predict('45fb9a671625463fa646c3523a3087d5', "http://samples.clarifai.com/face-det.jpg").then(
    //   function(response){
    //     console.log(response);
    //   },
    //   function(err){

    //   }
    // );  
  }
  render() {    
    return (
      <div className="App">
        <Particles className='particles'
          id="tsparticles"
          options={particlesOptions}
        />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm
         onInputChange = {this.onInputChange} 
         onSummit = {this.onSummit}
        />        
        {/*
        <FaceRecognition/> */}
      </div>
    );
  }
}

export default App;
